    struct FieldJc_t const*  theField = null;
    
    struct FieldJc_t const* theFieldP[1] ; theFieldP; /*J2C:modeAccess=Q*/
    
    MemSegmJc  theObject = { 0 };//J2C: constructor for embedded element
